import {
    fetchDogs,
    fetchTemperaments,
    filterByTemperaments
} from "../../redux/action/actions"
import React, { useEffect, useState } from "react";
import useAllDogs from "../../components/dogsHook";
import { useDispatch, useSelector } from "react-redux";

export const HomePage = ()=>{
    return(
        <div className="mt-5">
            <h1>Breed list</h1>
            <hr/>
            <table className="table">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Temperament</th>
                        <th>Weight</th>
                    </tr>
                </thead>
            </table>
        </div>
    )
}
